var TA21="UDP, TCP, ICMP 와는 다른 프로토콜을 사용하는 LAN 응용프로그램이 인터넷상으로 세션을 시작할 때, 공유기의 NAT 는 그 세션을 트랙합니다. 해당 프로토콜을 알지 못하는 경우라도 트랙 할 수 있습니다. 이 기능은 ALG 필요 없이 특정 응용프로그램 활성시 유용합니다.(대부분의 경우 원격지 호스트에 단일 VPN 연결 시)";
