var help33b="When the PPTP ALG is enabled, LAN computers can establish PPTP VPN connections either with the same or with different VPN servers. When the PPTP ALG is disabled, the router allows VPN operation in a restricted way. LAN computers are typically able to establish VPN tunnels to different VPN Internet servers but not to the same server. The advantage of disabling the PPTP ALG is to increase VPN performance. Enabling the PPTP ALG also allows incoming VPN connections to a LAN side VPN server (refer to <a href='adv_virtual.asp'>Advanced &rarr; VirtualServer</a>).";
var help39="H.323 클라이언트가 NAT를 통해 통신할 수 있습니다. 당신의 친구가 전화를 하고 싶다면 여러분은 또한 NetMeeting을위한 가상 서버를 설정해야합니다.<a href='adv_virtual.asp'> 고급 → 가상 서버 </a>에서 가상 서버를 설정하실 수 있습니다.";
var help41="이 기능은 LAN 컴퓨터 또는 기타 장치에 WAN에서 (특정 형식의 웨이크업 패킷입니다) \ \"매직 패킷을 \"의 전달 가능하게 \ (WOL) 능력 'LAN \에있는 웨이크 \".WOL 장치가 <a href='adv_virtual.asp'> 고급 → 가상 서버 </a> 페이지에서 이와 같은으로 정의되어야합니다.가상 서버의 LAN IP 주소는 일반적으로 브로드 캐스트 주소 192.168.0.255로 설정됩니다. 누구의 MAC 주소가 마법 패킷에 포함되어있는 LAN에있는 컴퓨터가 깨어 나길됩니다.";
