var help202="이것은 라우터가 USB 포트를 가지고, 당신은 USB 플래시 드라이브, PC에 USB 포트가있다면, 그래서, 그리고 PC가 Windows XP 서비스 팩 2 (SP2) 이상을 실행하면 PC와 사이의 무선 구성 데이터를 전송할 수USB 플래시 드라이브와 라우터.Windows 제어판으로 이동 및 무선 네트워크 설정 마법사를 선택합니다.무선 네트워크 설정 마법사가 당신에게 선택권을 제공 \ \"USB 플래시 드라이브를 사용하여 \"및 \ \"수동으로 네트워크를 설정합니다 \".에게 선택 \ \"USB 플래시 드라이브를 사용하여 \".";
