var help277="PPPoE 방식의 인터넷 서비스는 일정시간 인터넷을 사용하지 않을 경우, 자동으로 접속이 끊어집니다. 연결방식을 \"요청시 연결\" 로 선택하고 최대 대기 시간을 설정하여 두면 시간이 경과되어 끊어지더라도 인터넷 사용시 자동으로 재연결됩니다.";
var help283="PPTP 연결에서 최대 대기 시간을 설정하여 두시면 인터넷을 사용하지 않더라도 설정된 시간만큼 인터넷 연결이 유지됩니다. 물론, 설정된 대기 시간이 경과될 때까지 인터넷을 사용하지 않으면 연결은 끊어지지만 다시 인터넷을 사용할 때 자동으로 재연결되는 방식입니다.";
