var bws_msg_WEP_1="WEP 은 무선 암호화 표준입니다. WEP 을 사용하기 위하여 공유기와 무선 클라이언트에 동일한 key 를 설정해야 합니다. 64bit key 는 10개의 16진수 숫자를 입력해야 하며 128bit key 는 26개의 16진수 숫자를 입력해야 합니다. 16진수는 0~9, A~Z 를 사용합니다. 보다 안전한 보안을 구현하기 위하여 WEP 을 사용할 때의 인증 방식은 \"Shared Key\" 로 설정합니다.";
