var af_EFT_h5="이 옵션중의 일부는 다른 포트 제한과 같이 동작할 수 있습니다. 엔드포인트 독립 필터링(Endpoint Independent Filtering)이 수신 필터나 스케쥴에 우선합니다. 따라서, 해당 포트상의 액티브 수신 필터에도 불구하고 포트를 통해 들어가는 송신 세션과 관련된 수신 세션 요청이 가능합니다. 그러나, 예상대로 액티브 세션이 없는 차단된 포트(스케쥴에 의해 차단되었든지, 수신 필터로 차단되었든지) 로 패킷이 전송될 때 해당 패킷들은 차단 될 것입니다. 포트와 주소 제한 필터링(Address Restricted Filtering)을 사용하여 수신 필터와 스케쥴이 정확하게 동작할 수 있도록 해 줍니다. 그러나, 일부 연결을 제한 할 수 있어 응용프로그램에서 필요한 포트를 열기 위해 포트 트리거, 가상 서버, 포트 포워딩 사용이 필요할 수도 있습니다. 주소 제한 필터링은 공유기의 특정 NAT 종류(특히, symmetric NAT)와 통신 문제를 피할 수 있게 해주지만, 수신 필터와 스케쥴 접근은 예상대로 동작하도록 그냥 둡니다.";
