var help_nat="NAT는 라우터가 장치에 IP를 할당해 장치를 접속할 수 있게 해 줍니다. 라우터 모드는 NAT가 동작하고, 해당네트워크에 있는 장치는 사설 IP를 받습니다. 이 것은 인터넷 연결을 하는데 유용합니다. AP 모드는 NAT가 동작하지 않으며, 이것은 라우터 뒤편에 다른 라우터가 있거나, 다른 장치가 IP 주소를 할당할때 유용합니다. Auto 모드는 WAN 포트에 공인 IP 주소 또는 사설 IP 주소를 받는지에 따라 어떤 모드가 적합한 모드인지 탐지하고 자동으로 변경됩니다. 라우터가 공인 IP 주소를 받는다면, 라우터 모드로 변경됩니다. 라우터가 사설 IP 주소를 받는다면, AP 모드로 변경됩니다.";
