var ADNS_HELP1="DNS는 도메인 네임 시스템의 약자입니다. DNS 서버는 폰북처럼 동작하고, 사람이 사용하기에 익숙한 도메인 이름을 상응하는 IP 주소로 전환시켜 줍니다. 진보된 DNS 서비스는 베스트 페스 네트워크스에서 제공됐으며, 부수적으로 오픈DNS에서 안티피싱기능을 제공합니다. 오픈DNS는 무료 시큐리티와 DNS 기반 서비스를 제공하는 세계적으로 크게 성장하고 있는  프로바이더입니다. 진보된 DNS 서비스는 온라인 서비스를 안전하고, 인터넷을 통해 빠르고 신뢰할수 있게 합니다.";
var ADNS_HELP2="DNS 플렛폼은 특정 프로토콜에 간섭을 받지 않도록 설계되었습니다. 작은 서브넷의 스팸필터링 솔류션은 존재하지 않은 도메인을 위한 검색응답을 받으므로해서 혼동되기도 한다. 진보된 검색은 온 사이트 메일서버로 운영되는 클라이언트를 위해 동작하지 않도록 권장합니다. DNS는 업로드 또는 다운로드 속도에 영향을 주지 않습니다. 인터넷 서비스 프로바이더에 의해 전적으로 컨트럴 됩니다. 디링크와 베스트 페스 네트워크스는 진보된 DNS 서비스 사용자의 개인 식별 DNS 정보를 수집하거나 저장하지 않습니다.";
var ADNS_HELP3="검색결과는 야후를 통해 만들어 집니다. 검색기능은 유동적인 브라우징 기능을 제공합니다. 사이트에 접속하지 못하거나, 사이트가 존재하지 않으면브라우져에 오류메세지를 나타내는 대신에 검색제안을 제공합니다. 사용자가 만든 보통의 오타를 주소바에 자동으로 수정해 줍니다. 자동수정 기능은 오타 .cmo .ogr 또는 때때로 잘못 지정된 검색 결과 페이지 등 최상레벨의 도메인에서 제공됩니다. 만일  스팸 이메일 링크를 클릭하면 악용으로 인해 사이트를 동작하지 못하게 만듭니다. 왜냐하면 받은 검색 페이지에 사이트는 더 이상 존재하지 않습니다.";
